import { NavLink } from "react-router-dom";
const Navbar = () => {
  return (
    <nav className="navbar">
      <NavLink
        to="/main"
        className={({ isActive }) => (isActive ? "link active" : "link")}
      >
        Main
      </NavLink>

      <NavLink
        to="/account"
        className={({ isActive }) => (isActive ? "link active" : "link")}
      >
        Account
      </NavLink>
      <NavLink
        to="/messages"
        className={({ isActive }) => (isActive ? "link active" : "link")}
      >
        Messages
      </NavLink>
      <NavLink
        to="/login"
        className={({ isActive }) => (isActive ? "link active" : "link")}
      >
        Login
      </NavLink>
    </nav>
  );
};
export default Navbar;
